import React from 'react';
import '../css/IndProject.css';





class IndProject extends React.Component {
    render () {

        return (<div className="ind-project">
                <div className="ind-sub-div col-10">
                    <div className="col-6 image-side">
                        
                    </div>
                    <div className="col-6">
                        <span>{this.props.project.title}</span>
                        <p>{this.props.project.description}</p>
                        {this.props.project.techStack.map(item => 
                            <div class="project-skill-container">
                                <span>{item}</span>
                            </div>
                        )}
                        <div class="buttons-div">
                            <button>{this.props.project.gitHubPagesURL}</button>
                            <button>{this.props.project.gitHubRepoURL}</button>
                        </div>
                    </div>
                </div>

                <hr className="col-11"></hr>
            </div>
        );
    }
}

export default IndProject;
